B.aEC=A.a(s([';BOLD[[CGRN[["\u012e ind\u0105, kuriame yra 4,5 kg 60\xb0C temperat\u016bros vandens, \u012fmestas 1,5 L t\u016brio 0\xb0C temperat\u016bros ledo gabalas.\nKokia bus vandens temperat\u016bra i\u0161tirpus ledui?\nVandens tankis \u03c1 = 1000 kg/m\xb3, vandens savitoji \u0161iluma c = 4200J/(kg\u22c5\xb0C), ledo savitoji lydimosi \u0161iluma \u03bb = 330\u22c510\xb3 kJ/kg."]]]]|N_2|',";Suprantame, jog BOLD[[tai \u0161ilumin\u0117s energijos (termodinamikos) u\u017edavinys]].",";BOLD[[Pasi\u017eymime kas duota, k\u0105 reikia rasti]] ir BOLD[[paver\u010diame]] vis\u0173 duot\u0173 dyd\u017ei\u0173 matavimo BOLD[[vienetus \u012f SI sistemos vienetus]]: 1,5 litro (L) paver\u010diame \u012f kvadratinius metrus (m\xb3).",";Pirmiausia suprantame, jog 60\xb0C temperat\u016bros vanduo atv\u0117so ir BOLD[[atidav\u0117 energijos QSUBB[[1]]]].\n\u017dinome, jog ledo gabalas i\u0161silyd\u0117, tod\u0117l tam BOLD[[sunaudota energijos QSUBB[[\u2082]]]], bei pa\u0161ilo iki nusistov\u0117jusios temperat\u016bros, tod\u0117l tam BOLD[[dar sunaudota energijos QSUBB[[\u2083]]]]. U\u017era\u0161ome \u0161i\u0173 energij\u0173 formules.",";Mes BOLD[[ne\u017einome ledo gabalo mas\u0117s]], tod\u0117l j\u0105 pasi\u017eymime kaip mDFLT[[\u2097]]BOLD[[ ta\u010diau turime jo tank\u012f ir t\u016br\u012f]], tod\u0117l BOLD[[surandame mas\u0119 naudodamiesi jos formule mSUBB[[1]]=\u03c1VSUBB[[1]]]].",";Kadangi turime visus dyd\u017eius antrajai energijai (QDFLT[[\u2082]]) apskai\u010diuoti, taip ir padarome.",";Matome, kad ir tre\u010diai energijai (QDFLT[[\u2083]]) apskai\u010diuoti reikalinga antra mas\u0117 (mDFLT[[\u2097]]), tod\u0117l \u012f jos formul\u0119 taip pat \u012fstatome jai apskai\u010diuoti skirt\u0105 formul\u0119 mDFLT[[\u2097]]=\u03c1VDFLT[[\u2097]].",";BOLD[[Kadangi nusistov\u0117jo \u0161ilumin\u0117 pusiausvyra]], XBLD[[sulyginame vandens atiduot\u0105 ir sunaudotas energijas]], nes pagal energijos tverm\u0117s d\u0117sn\u012f, atiduota \u0161iluma lygi gautai \u0161ilumai (nes ji niekur nedingsta).",";BOLD[[Mums reikia rasti ne\u017einom\u0105 temperat\u016br\u0105 tSUBB[[x]]]], tod\u0117l j\u0105 turime i\u0161sireik\u0161ti i\u0161 turimos lygyb\u0117s (trij\u0173 sulygint\u0173 energij\u0173) ITAL[[(kaip tai lengviau padaryti, galite rasti formuli\u0173 i\u0161rei\u0161kimo pamokoje)]].",";Gav\u0119 formul\u0119, \u012fstatome duotus duomenis ir apskai\u010diuot\u0105 antr\u0105j\u0105 energij\u0105 QDFLT[[\u2082]] \u012f gaut\u0105 formul\u0119 ir gauname atsakym\u0105."]),t.s)
