B.aB8=A.a(s(["XBLD[[\u2022 ]];XBLD[[Svorio j\u0117ga]] BOLD[[priklauso nuo aplinkos]] - t.y. nuo laisvojo kritimo pagrei\u010dio.\nBe to, ji matuojamas Niutonais (N).","BOLD[[\u2022 ]];XBLD[[Mas\u0117]] - BOLD[[visur ir visada vienoda]], nes rei\u0161kia k\u016bn\u0105 sudaran\u010di\u0173 daleli\u0173 kiek\u012f.\nJi matuojama kilogramais (kg).","BOLD[[\u2022 ]];Taigi, BOLD[[kalb\u0117dami apie \u017emog\u0173]], turime sakyti, BOLD[[kokia jo mas\u0117]], o ne svoris.\nLengva atskirti, nes nesakome, jog \u017emogus sveria 80 (800) niuton\u0173. Reikia sakyti, jog \u017emogaus mas\u0117 yra 80 kilogram\u0173."]),t.s)
