B.aBj=A.a(s([";XBLD[[Konvertuokime 72 kilometrus per valand\u0105 \u012f metrus per sekund\u0119:]]",";CBLU[[\u017dinome, jog viena valanda 1h = 60min = 3600s.]]\nTaigi, BOLD[[1h/3600s ir 3600s/1h yra lygu 1]].",";CBLU[[Taip pat, vienas kilometras 1km = 1000m.]]\nTaigi, BOLD[[1km/1000m ir 1000m/1km lygu 1]].",";Mums i\u0161 turim\u0173 72km/h reikia i\u0161prastinti valandas (h) ir taip gauti likusias sekundes (s) bei i\u0161prastinti kilimetrus (km) ir gauti likusius metrus (m).",";BOLD[[Pirma pakeiskime valandas sekund\u0117mis:]]\nKadangi CBLU[[valandos apa\u010dioje]], kitoje trupmenoje CBLU[[jos turi b\u016bti vir\u0161uje]]. CBLU[[Apa\u010dioje lieka 3600 sekund\u017ei\u0173]]:\nVadinasi, XBLD[[dauginame i\u0161 trupmenos 1h/3600s]]:",";72km/CROS[[h]] \u22c5 1CROS[[h]]/3600s = 72km \u22c5 1/3600s =\n72/3600 km/s = 0,02 km/s",";BOLD[[Dabar kilometrus pakeiskime metrais:]]\nKadangi CBLU[[kilometrai vir\u0161uje]], kitoje trupmenoje CBLU[[jie turi b\u016bti apa\u010dioje]]. CBLU[[Vir\u0161uje lieka 1000 metr\u0173]]:\nVadinasi, XBLD[[dauginame i\u0161 trupmenos 1000m/1km]].",";0,02CROS[[km]]/s \u22c5 1000m/1CROS[[km]] = 0,02/1s \u22c5 1000m =\n0,02 \u22c5 1000 m/s = 20 m/s",";CBLU[[72km/h = 20m/s]]"]),t.s)
