B.aDZ=A.a(s(["Perk\u016bnijos metu niekada nestov\u0117kite po auk\u0161tais med\u017eiais, neva\u017eiuokite dvira\u010diu, nesimaudykite up\u0117je ar e\u017eere, neplaukiokite valtimi, venkite i\u0161kili\u0173 viet\u0173, u\u017edarykite namo/buto langus.","Nuo \u017eaibo saugo metalinis automobilis ar \u017eema vietov\u0117","Jei norite i\u0161gelb\u0117ti \u012f elektros grandin\u0119 patekus\u012f \u017emog\u0173, jo nelieskite, pirmiausia i\u0161junkite grandin\u0119 jungikliu ar saugikliais","Viena ranka laikydami \u012fjungt\u0105 elektrin\u012f prietais\u0105, tuo pat metu kita nelieskite vandentiekio \u010diaupo, centrinio \u0161ildymo sistemos vamzd\u017ei\u0173","Nejunkite prietais\u0173, jei pa\u017eeista jungiam\u0173j\u0173 laid\u0173 izoliacija","Vonioje ned\u017eiovinkite plauk\u0173 elektriniu d\u017eiovintuvu, nejunkite televizoriaus ar radijo imtuvo","Neplaukite vandeniu prie elektros srov\u0117s \u0161altinio prijungt\u0173 elektrini\u0173 prietais\u0173","Netraukite i\u0161 elektros lizdo ki\u0161tuk\u0173 u\u017e laido","Valydami bute lemputes ar \u0161viestuvus, i\u0161junkite saugiklius","Jei bute yra ma\u017e\u0173 vaik\u0173, lizdus u\u017edenkite apsauginiais skydeliais","Stov\u0117dami basi ant plikos \u017eem\u0117s arba cementini\u0173 grind\u0173, nesinaudokite elektriniais prietaisais","Nelieskite kur nors nukarusi\u0173 laid\u0173","Apie nukarusius elektros laidus prane\u0161kite elektrikams","Elektrinius prietaisus turi taisyti tik specialistai"]),t.s)
