B.b4j=new A.c0("Praktikoje da\u017eniau naudojami suglausti puslaidininkiai, BOLD[[kuri\u0173 vienai daliai b\u016bdingas p laidumas, o kitai \u2014 n laidumas. \u0160i\u0173 dali\u0173 kontaktas vadinamas pn sand\u016bra.]] Ji pakei\u010dia kr\u016bvinink\u0173 i\u0161sid\u0117stym\u0105 kiekviename i\u0161 suglaust\u0173 puslaidininki\u0173.|N_6|Jeigu toks puslaidininkis yra ne\u012fjungtas \u012f elektros grandin\u0119, kai kurie elektronai pereina \u012f p srit\u012f, o kai kurios skyl\u0117s - \u012f n srit\u012f. CBLU[[Taip puslaidininki\u0173 sand\u016bra \u012fsielektrina ir atsiranda elektrinis laukas, kuris trukdo laisviesiems elektronams ir skyl\u0117ms toliau skverbtis \u012f prie\u0161ingas sritis.]]",!1,16,null)
B.b4k=new A.c0("BOLD[[Dyzeliniai varikliai]] veikia beveik taip pat, jie i\u0161 esm\u0117s skiriasi tik tuo, BOLD[[kad neturi u\u017edegimo \u017evak\u0117s]].|N_1|CBLU[[Cilindre susl\u0117gtas oras \u012fkaista iki 500\u2014 700 \xb0C. Nuo jo savaime suspaudimo takto pabaigoje u\u017esiliepsnoja dideliu sl\u0117giu \u012fpurk\u0161ti \u012f cilindr\u0105 degalai.]]",!1,16,null)
B.b4l=new A.c0("Praktikoje laidininkai retai jungiami grandin\u0117je vien nuosekliai arba vien lygiagre\u010diai. Toje pa\u010dioje grandin\u0117je da\u017enai derinamas lygiagretusis ir nuoseklusis laidinink\u0173 jungimas.",!1,16,null)
B.b4m=new A.c0("BOLD[[A]] - amplitud\u0117, BOLD[[T]] - periodas, BOLD[[\u03bb]] - bangos ilgis",!1,16,null)
B.b4n=new A.c0("1m ilgio stiklinis vamzdelis, kurio vienas galas u\u017elydytas, pripilamas gyvsidabrio. U\u017edengus atvir\u0105j\u012f gal\u0105, vamzdelis apver\u010diamas ir panardinamas \u012f plat\u0173 ind\u0105 su gyvsidabriu. Dalis gyvsidabrio i\u0161 vamzdelio i\u0161b\u0117ga \u012f ind\u0105, o vamzdelyje lieka apie BOLD[[760mm auk\u0161\u010dio gyvsidabrio stulpelis]]. Vir\u0161 jo susidaro beor\u0117 erdv\u0117. |N_4|XBLD[[\u0160\u012f bandym\u0105 galima paai\u0161kinti taip:]] atmosferos sl\u0117gis \u012f inde esan\u010dio gyvsidabrio atvir\u0105 pavir\u0161i\u0173 atsveria vamzdelyje likusio gyvsidabrio stulpelio sl\u0117g\u012f.",!1,16,null)
B.b4o=new A.c0("Ampermetras \u012f elektrin\u0119 grandin\u0119 XBLD[[jungiamas nuosekliai]] tam prietaisui, kurio stipris matuojamas.",!1,16,null)
B.b4p=new A.c0('Tod\u0117l tikriausiai ai\u0161ku, kod\u0117l kai kada sakoma taip: \u201e\u0160iandien atmosferos sl\u0117gis yra 750 mm gyvsidabrio stulpelio". Vadinasi, t\u0105 dien\u0105 atmosferos sl\u0117gis atsveria 750 mm auk\u0161\u010dio gyvsidabrio stulpelio sl\u0117g\u012f.|N_4|Taigi yra dar vienas sl\u0117gio matavimo vienetas \u2014 XBLD[[gyvsidabrio stulpelio milimetras]]. Jis sutrumpintai \u017eymimas XBLD[[(mm Hg):]] BOLD[[1 mm Hg = 133,3 Pa]].',!1,16,null)
B.b4q=new A.c0("CBLU[[Norint i\u0161spr\u0119sti bet kok\u012f fizikos u\u017edavin\u012f reik\u0117t\u0173 laikytis keli\u0173 pagrindini\u0173 praktik\u0173.]] Yra labai svarbu BOLD[[\u012fsiskaityti \u012f u\u017edavin\u012f ir suprasti, kas yra duota ir k\u0105 tiksliai reikia rasti.]] Taip pat atkreipti d\u0117mes\u012f \u012f duotus patarimus, patikslinimus ar netiesiogines reik\u0161mes.\nTaip pat, kaip ir daugelyje sri\u010di\u0173, BOLD[[svarbi praktika]]. CBLU[[Juo daugiau spresite pana\u0161i\u0173 u\u017edavini\u0173, juo geriau ir grei\u010diau gal\u0117site atpa\u017einti problem\u0105 ir sudaryti \u017eingsnius jai i\u0161spr\u0119sti.]]",!1,16,null)
B.b4r=new A.c0("Kaip matote, svorio j\u0117gos br\u0117\u017einyje (auk\u0161\u010diau), sunkio ir svorio j\u0117gos ypa\u010d ry\u0161kiai skiriasi tada, BOLD[[kai k\u016bnas laisvai krinta pagrei\u010diu g]].|N_4|BOLD[[\u2022 ]]Tuomet CBLU[[sunkio j\u0117ga nepakinta]], tarsi k\u016bnas b\u016bt\u0173 rimties b\u016bsenos.\nBOLD[[\u2022 ]]CBLU[[Svoris pasidaro lygus nuliui]] \u2014 k\u016bnas nespaud\u017eia atramos ir netempia pakabos. K\u016bnas yra nesvarus.",!1,16,null)
B.b4s=new A.c0("XBLD[[Infragarsas:]] Da\u017enu atveju BOLD[[kenkia \u017emogui]], nes m\u016bs\u0173 ausys jo negirdi, ta\u010diau j\u012f jau\u010dia k\u016bnas. Sukelia nerim\u0105, baim\u0119, nuovarg\u012f. BOLD[[Ypa\u010d pavojingas 7-8 Hz garsas]], nes jis priver\u010dia vibruoti organus, sutampa su \u0161irdies bei smegen\u0173 savitaisiais da\u017eniais ir gali trikdyti \u0161i\u0173 organ\u0173 veikl\u0105. Gyv\u016bnai infragars\u0105 junta geriau nei \u017emon\u0117s, tod\u0117l naminiai gyv\u016bnai reaguoja audriai prie\u0161 prasidedant audroms ar art\u0117jant perk\u016bnijai.|N_2|BOLD[[J\u012f sukelia:]] autobusai, audros, \u017eem\u0117s dreb\u0117jimai, uraganai, sprogimai ir t.t.|N_4|XBLD[[Ultragarsas:]] BOLD[[D\u0117l ma\u017eo bangos ilgio gali sklisti siaurais pluo\u0161tais ir atsispind\u0117ti nuo ma\u017e\u0173 matmen\u0173 kli\u016b\u010di\u0173.]]|N_2|Naudojamas echolotuose, echoskopams gaminti. Ultragarsas pla\u010diai taikomas medicinoje ligoms diagnozuoti, v\u0117\u017eiui, s\u0105nari\u0173 u\u017edegimui, radikulitui gydyti, l\u016b\u017eusiems kaulams sujungti ir kt. Ultragarsu gali b\u016bti sterilizuojami maisto produktai, kartais jis naudojamas kaip s\u0117kl\u0173 dygimo, augal\u0173 augimo ir brendimo stimuliatorius.",!1,16,null)
B.b4t=new A.c0("XBLD[[Telefon\u0105 i\u0161rado]] BOLD[[Aleksandras Grejamas Belas (A. G. Belas)]] 1876 metais.",!1,16,null)
B.b4u=new A.c0("ITAL[[Puslaidininki\u0173 laidumo ypatybes paai\u0161kinsime naudodamiesi IV grup\u0117s cheminio elemento silicio (Si) sandara.]]|N_2|\u0160ios grup\u0117s element\u0173 atom\u0173 BOLD[[i\u0161oriniame sluoksnyje yra po keturis elektronus]] ITAL[[(paveiksle geltoni skrituliukai)]].|N_6|CBLU[[Kai temperat\u016bra \u017eema]], \u0161ie elektronai yra stipriai susij\u0119 su atomais ir laisv\u0173j\u0173 elektron\u0173 beveik n\u0117ra. CBLU[[Toks silicis \u2014 izoliatorius.]]|N_1|CBLU[[Kaitinant silic\u012f]], kai kurie jo elektronai \u012fgyja pakankamai energijos, nutraukia ry\u0161\u012f su atomu ir tampa laisvais (paveiksle m\u0117lyni skrituliukai). CBLU[[Toks silicis - laidininkas.]]|N_6|BOLD[[Juo auk\u0161tesn\u0117 silicio temperat\u016bra]], juo daugiau jame atsiranda laisv\u0173j\u0173 elektron\u0173, BOLD[[juo laidesnis jis tampa]].",!1,16,null)
B.b4v=new A.c0("Kalb\u0117dami apie mechanizm\u0173 (sverto ir kt.) atlikt\u0105 darb\u0105, neatsi\u017evelg\u0117me \u012f trint\u012f ir t\u0173 prietais\u0173 svor\u012f. Pavadin\u0119 mechanizmo atlikt\u0105 darb\u0105 kroviniui pakelti naudinguoju darbu, o veikian\u010dios j\u0117gos darb\u0105 \u2014 visu darbu ir juos palygin\u0119, pamatysime, kad BOLD[[naudingasis darbas visada ma\u017eesnis u\u017e vis\u0105 darb\u0105]]: ADFLT[[\u2099]] < ADFLT[[\u1d65]].|N_2|Naudingumo koeficientas gali b\u016bti i\u0161reik\u0161tas skai\u010diumi (0 < \u03b7 < 1) arba procentais (0% < \u03b7 < 100%).",!1,16,null)
B.b4w=new A.c0("BOLD[[Kai puslaidininkio p sritis prijungta prie srov\u0117s \u0161altinio teigiamojo poliaus, o n sritis \u2014 prie neigiamojo poliaus, per \u0161i\u0105 sand\u016bra]] XBLD[[srov\u0117 teka.]]|N_2|Elektronai teka link teigiamojo \u0161altinio poliaus, kuris yra p srities pus\u0117je. Kadangi p sritis irgi teigiama, joje daug teigiam\u0173 skyli\u0173, \u012f j\u0105 juda elektronai, o skyl\u0117s atitinkamai link n srities. Kadangi yra kryptingas kr\u016bvinink\u0173 jud\u0117jimas, teka srov\u0117.",!1,16,null)
B.b4x=new A.c0("Reikia \u012fsid\u0117m\u0117ti, jog kroviniui pakelti nuo\u017eulni\u0105ja plok\u0161tuma reikia tiek kart\u0173 ma\u017eiau j\u0117gos, BOLD[[kiek kart\u0173 ta plok\u0161tuma k\u016bno nueitas kelias yra ilgesnis u\u017e k\u016bno pakilimo auk\u0161t\u012f]].|N_2|Pa\u017eym\u0117jus darb\u0105, reikaling\u0105 kroviniui pakelti vertikaliai \u012f auk\u0161t\u012f h ADFLT[[\u2081]], o darb\u0105, atliekam\u0105 t\u0105 pat\u012f krovin\u012f pakeliant \u012f t\u0105 pat\u012f auk\u0161t\u012f h nuo\u017eulni\u0105j\u0105 plok\u0161tum\u0105 A\u2082, gauname lygyb\u0119 Ph=Fl, arba santyk\u012f P/F = l/h.|N_4|ITAL[[Nuo\u017eulniosios plok\u0161tumos naudojamos siekiant lengviau pakelti sunkius daiktus ir pan.]]\nITAL[[Pvz.: sunk\u016bs daiktai \u012f sunkve\u017eim\u012f \u012fridenami storomis lentomis, o ne keliami tiesiai auk\u0161tyn, \u012f stat\u0173 kaln\u0105 lipame vingiais, o ne tiesiausiu keliu.]]",!1,16,null)
B.b4y=new A.c0("Susisiekian\u010di\u0173j\u0173 ind\u0173 principas pla\u010diai taikomas buityje ir technikoje: laistytuvai, kavinukai bei arbatinukai gaminami su snapeliais; su dideliu vandens rezervuaru sujung\u0119 stiklin\u012f vamzdel\u012f, galime kontroliuoti vandens lyg\u012f; kanalizacijos sistemoje susisiekiantieji indai (i\u0161lenkta ir vandens pripildyta vamzd\u017eio dalis) trukdo smarvei patekti \u012f kambar\u012f ITAL[[(paveiksl\u0117lyje)]]. \u0160iuo principu pagr\u012fstas \u0161liuz\u0173 ir vandentiekio veikimas.",!1,16,null)
B.b4z=new A.c0("BOLD[[Elektros grandin\u0117 apskai\u010diuota tam tikram did\u017eiausiam srov\u0117s stipriui.]] CBLU[[Jeigu ja pradeda tek\u0117ti stipresn\u0117 u\u017e leid\u017eiam\u0105j\u0105 srov\u0117, jungiamieji laidai gali labai smarkiai \u012fkaisti ir u\u017esidegti.]]|N_2|Srov\u0117s stipris grandin\u0117je gali padid\u0117ti, kai susilie\u010dia neizoliuoti jos laidai, kai grandin\u0117 taisoma nei\u0161jungta i\u0161 tinklo, kai \u012f j\u0105 \u012fjungiami ma\u017eos var\u017eos imtuvai arba \u012f grandin\u0119 \u012fjungus imtuvus, kuriems maitinti reikia stipresn\u0117s srov\u0117s (perkrovus grandin\u0119). BOLD[[Visais \u0161iais atvejais \u012fvyksta trumpasis jungimas.]]|N_2|BOLD[[Norint to i\u0161vengti \u012f tinkl\u0105 \u012fjungiami saugikliai.]] Jie automati\u0161kai i\u0161jungia elektros grandin\u0119 kai srov\u0117s stipris joje pasidaro didesnis u\u017e leid\u017eiam\u0105j\u012f.",!1,16,null)
B.b4A=new A.c0("BOLD[[Skys\u010dio manometrus sudaro susisiekiantieji indai, pripildyti skys\u010dio.]] Tai lenktas stiklinis vamzdelis, pritvirtintas prie stove \u012ftaisytos skal\u0117s (1 pav.). \u012e vamzdel\u012f iki nulin\u0117s padalos pripilta vandens (kad geriau matyt\u0173si, nuda\u017eyto). Nedidel\u0117 d\u0117\u017eut\u0117, kurios vir\u0161us u\u017edengtas plona gumine pl\u0117vele sujungtas \u017earnele su viena manometro at\u0161aka.|N_4|BOLD[[Apie sl\u0117gio didum\u0105 sprend\u017eiame i\u0161 vandens stulpelio auk\u0161\u010dio h]] (2 pav., kairysis pav.). Jei norime su\u017einoti sl\u0117g\u012f kurio nors skys\u010dio viduje, su manometru sujungt\u0105 d\u0117\u017eut\u0119 panardiname \u012f t\u0105 skyst\u012f (2 pav., de\u0161inysis pav.). CBLU[[Juo giliau grimzta d\u0117\u017eut\u0117, juo auk\u0161tesnis skys\u010dio stulpelis atsveriamas]], taigi didesnis ir jo sl\u0117gis.",!1,16,null)
B.b4B=new A.c0("BOLD[[Garo turbin\u0105 sudaro ant veleno u\u017emautas diskas (1) su mentel\u0117mis (2).]]|N_1|Tarp \u0161i\u0173 menteli\u0173 \u012ftaisyti kreipra\u010diai su nejudamomis ment\u0117mis. Jos nukreipia i\u0161 katilo i\u0161siver\u017eian\u010dius garus \u012f disko menteles. Sl\u0117gdami jas, garai greitai suka disk\u0105. Turbina sukasi.|N_2|CBLU[[\u0160iuolaikin\u0117se turbinose ant vieno veleno u\u017emaunama keletas toki\u0173 disk\u0173.]] Garai i\u0161 eil\u0117s pereina pro vis\u0173 j\u0173 menteles.",!1,16,null)
