B.b4F=new A.c0("XBLD[[J\u0117gos moment\u0173 taisykl\u0117 teigia]], jog j\u0117g\u0173 moment\u0173, sukan\u010di\u0173 k\u016bn\u0105 laikrod\u017eio rodykl\u0117s jud\u0117jimo kryptimi, suma yra lygi j\u0117g\u0173 moment\u0173, sukan\u010di\u0173 j\u012f prie\u0161inga kryptimi, sumai.",!1,16,null)
B.b4G=new A.c0("Bet kurioje \u017dem\u0117s vietoje pad\u0117ta magnetin\u0117 rodykl\u0117, galinti laisvai sukiotis, visuomet nusistovi \u0161iaur\u0117s-piet\u0173 kryptimi, nes j\u0105 veikia \u017dem\u0117s magnetinis laukas. Taigi, BOLD[[\u017dem\u0117 yra mil\u017eini\u0161kas magnetas, turintis du magnetinius polius]]: \u0161iaurin\u012f \u2014 Piet\u0173 pusrutulyje ir pietin\u012f \u2014 \u0160iaur\u0117s pusrutulyje (\u012f kur\u012f nukrypsta magnetin\u0117s / kompaso rodykl\u0117s \u0161iaurinis polius.|N_2|CBLU[[Geografinio a\u0161igalio pad\u0117tis pastovi, o magnetinio poliaus kinta.]] Jis pastoviai po truput\u012f art\u0117ja prie a\u0161igali\u0173.|N_6|BOLD[[\u017dem\u0117s magnetinio lauko prie\u017eastys:]] skysta gele\u017eis (Fe) ir nikelis (Ni) \u017dem\u0117s i\u0161oriniame branduolyje.|N_2|",!1,16,null)
B.b4H=new A.c0("Vidaus degimo varikliai, garo turbinos ir kiti \u0161iluminiai varikliai tik dal\u012f kuro i\u0161skiriamos energijos paver\u010dia mechaniniu darbu. I\u0161 variklio i\u0161\u0117j\u0119 garai ar dujos dar turi energijos. CBLU[[Juo didesn\u0117 vidin\u0117s kuro energijos dalis \u0161iluminiame variklyje paver\u010diama naudinguoju darbu, juo ekonomi\u0161kesnis variklis \u2014 didesnis jo naudingumo koeficientas.]]|N_2|BOLD[[Naudingasis darbas A]]DFLT[[\u2099]]BOLD[[ visada ma\u017eesnis u\u017e vidin\u0119 kuro energij\u0105 Q : A]]DFLT[[\u2099]]BOLD[[ < Q]].|N_1|CBLU[[Naudingumo koeficientas gali b\u016bti i\u0161reik\u0161tas skai\u010diumi (0 < \u03b7 < 1) arba procentais (0% < \u03b7 < 100%).]]",!1,16,null)
B.b4I=new A.c0("Archimedo j\u0117g\u0105, veikian\u010di\u0105 tam tikr\u0105 k\u016bn\u0105 skystyje galima i\u0161matuoti ir naudojant dinamometr\u0105 (prietais\u0105, skirt\u0105 apskai\u010diuoti j\u0117gai). Dinamometru i\u0161matuokite to k\u016bno svor\u012f ore ir tada jo svor\u012f vandenyje. Svorio ore ir vandenyje skirtumas lygu Archimedo j\u0117gai (FDFLT[[\u2090]] = PDFLT[[\u2092]] - PDFLT[[\u209b\u2096]] ).",!0,13,null)
B.b4J=new A.c0("CBLU[[K\u016bn\u0105 sudaran\u010dios molekul\u0117s ir kitos dalel\u0117s turi dviej\u0173 r\u016b\u0161i\u0173 mechanin\u0117s energijos \u2014 kinetin\u0117s ir potencin\u0117s.]] Potencin\u0117 daleli\u0173 energija priklauso nuo j\u0173 tarpusavio pad\u0117ties (susijusi su daleli\u0173 tarpusavio trauka ar st\u016bma), o kinetin\u0117 \u2014 nuo judan\u010di\u0173 daleli\u0173 grei\u010dio.|N_2|BOLD[[Vidin\u0117 k\u016bn\u0173 energija gali kisti atliekant darb\u0105 ir perduodant \u0161ilum\u0105.]]",!1,16,null)
B.b4K=new A.c0("Paveiksl\u0117lyje pavaizduota, kokios j\u0117gos veikia skystyje panardint\u0105 k\u016bn\u0105. I\u0161 \u0161on\u0173 ta\u0161el\u012f veikia j\u0117gos, kurios yra vienodo didumo, bet prie\u0161ing\u0173 kryp\u010di\u0173. Jos atsveria viena kit\u0105. Vir\u0161utin\u0119 ta\u0161elio dal\u012f skys\u010dio stulpelis hDFLT[[\u2081]] veikia j\u0117ga FDFLT[[\u2081]], apatin\u0119 \u2014 stulpelis h\u2082 j\u0117ga F\u2082. Kadangi h\u2082 > hDFLT[[\u2081]] tai ir F\u2082 > FDFLT[[\u2081]]. J\u0117g\u0173 FDFLT[[\u2081]] ir F\u2082 atstojamoji ir yra Archimedo j\u0117ga FDFLT[[\u2090]]  = F\u2082 - FDFLT[[\u2081]]. Ji nukreipta \u012f didesniosios j\u0117gos pus\u0119 (auk\u0161tyn).|N_4|BOLD[[Kitaip tariant:]] sl\u0117gis \u017eemiau k\u016bno yra didesnis negu auk\u0161\u010diau k\u016bno (nes skys\u010diai sl\u0117g\u012f perduoda \u012f visas puses vienodai), tod\u0117l jis vandens stumiamas \u012f vir\u0161\u0173 didesne j\u0117ga nei \u012f apa\u010di\u0105. CBLU[[Tas j\u0117g\u0173 skirtumas ir yra Archimedo j\u0117ga.]]|N_4|",!1,16,null)
B.b4L=new A.c0("BOLD[[Did\u0117jant temperat\u016brai puslaidininki\u0173 var\u017ea ma\u017e\u0117ja, o laidinink\u0173 (metal\u0173) did\u0117ja.]]|N_4|XBLD[[Termistorius]] - (var\u017eas) priklauso nuo \u0161ilumos,|N_1|XBLD[[Fotorezistorius]] - (var\u017eas) priklauso nuo \u0161viesos.|N_4|BOLD[[Laisvieji elektronai (n):]] (-),|N_1|BOLD[[Skyl\u0117s (p):]] (+).|N_4|XBLD[[Savaiminis laidumas:]]|N_1|BOLD[[1. Elektrinis]] (n p n - daugiau laisv\u0173 elektron\u0173),|N_1|BOLD[[2. Skylinis]] (p n p - daugiau skyli\u0173).|N_4|XBLD[[Priemai\u0161os:]]|N_1|BOLD[[1. Donorin\u0117s]] (atiduoda elektronus),|N_1|BOLD[[2. Akceptorin\u0117s]] (prisijungia elektronus)|N_4|XBLD[[Laid\u017eioji kryptis]] - srov\u0117 teka viena kryptimi (p yra daug (-), n daug (+) kr\u016bvinink\u0173),|N_1|XBLD[[U\u017etvarin\u0117 kryptis]] - prie\u0161prie\u0161in\u0117 srov\u0117 (p yra (+), n yra (-) kr\u016bvininkai).|N_2|",!1,16,null)
B.b4M=new A.c0("Skys\u010dio molekul\u0117s nuolat juda \u012fvairiu grei\u010diu. Grei\u010diausios, atsid\u016brusios skys\u010dio pavir\u0161iuje, \u012fveikia kit\u0173 molekuli\u0173 trauk\u0105 ir i\u0161lekia i\u0161 jo \u012f or\u0105 nematomais garais. Taip i\u0161 atviro indo skystis pama\u017eu i\u0161garuoja.|N_1|BOLD[[Garavimas vyksta bet kokioje temperat\u016broje, tik med\u017eiagos pavir\u0161iuje.]]|N_6|BOLD[[Virimas vyksta tik skys\u010dio virimo temperat\u016broje, ta\u010diau visame skys\u010dio t\u016bryje.]]|N_1|CBLU[[Virimo temperat\u016bra priklauso nuo sl\u0117gio - dideliame sl\u0117gyje auk\u0161tesn\u0117 virimo temperat\u016bra, ma\u017eesniame sl\u0117gyje - \u017eemesn\u0117.]]",!1,16,null)
