B.b4O=new A.c0("BOLD[[Bet kurios formos susisiekian\u010diuosiuose induose nejudan\u010dio vienaly\u010dio skys\u010dio lygis yra vienodas.]]|N_4|\u017dinome, kad skys\u010dio stulpelio sl\u0117gis priklauso nuo stulpelio auk\u0161\u010dio. Kadangi vienodas stulpeli\u0173 auk\u0161tis, tod\u0117l vienodas abiejuose stulpeliuose ir sl\u0117gis.",!1,16,null)
B.b4P=new A.c0("Paversti i\u0161vestinius dyd\u017ei\u0173 vienetus, sudarytus i\u0161 keli\u0173 pagrindini\u0173 vienet\u0173 \u012f kitus arba bet kokius kitus vienetus BOLD[[yra \u0161iek tiek sud\u0117tingiau]], BOLD[[ta\u010diau i\u0161mokus]] apie toliau kalbam\u0105 metod\u0105 - BOLD[[gana paprasta]].|N_4|XBLD[[Svarbiausia yra mok\u0117ti t\u0173 dyd\u017ei\u0173 vertimo reik\u0161mes]] ITAL[[(t.y. kiek viename dydyje yra kit\u0173)]].|N_4|CBLU[[\u0160iuo b\u016bdu galima taip pat paversti ir vienetus su SI sistemos prie\u0161d\u0117liais \u012f kitus]], ta\u010diau prie\u0161 \u0161it\u0105 esan\u010diame puslapyje minimas metodas yra paprastesnis ir greitesnis.",!1,16,null)
B.b4Q=new A.c0('Formuli\u0173 i\u0161rei\u0161kimas algebriniu b\u016bdu patartinas tiems, kas nori mok\u0117ti i\u0161rei\u0161kti bet kokias formules universaliu, pla\u010diausiai naudojamu b\u016bdu. BOLD[[Nors jis gali pasirodyti gana sud\u0117tingas i\u0161 prad\u017ei\u0173, greitai supratus \u0161io b\u016bdo esm\u0119 jis tampa paprastu.]]|N_4|\u0160is b\u016bdas, kitaip nei "trikampis", XBLD[[tinka visoms formul\u0117ms]], nesvarbu i\u0161 kiek kintam\u0173j\u0173 ar matematini\u0173 \u017eenkl\u0173 jos sudarytos. XBLD[[Tai vienintelis b\u016bdas i\u0161reik\u0161ti ne\u017einom\u0105j\u012f i\u0161 dviej\u0173 ar daugiau sulygint\u0173 lyg\u010di\u0173.]]',!1,16,null)
B.b4R=new A.c0('Formuli\u0173 i\u0161sirei\u0161kimas "trikampiu" XBLD[[patartinas tiems, kas nori paprastas, trij\u0173 dyd\u017ei\u0173 formules i\u0161sireik\u0161ti paprastai ir greitai, daug negalvojant ir nesprend\u017eiant laiko pertvarkymams]].|N_4|Ta\u010diau, \u0161is b\u016bdas netinka visoms formul\u0117ms i\u0161sireik\u0161ti. Juo galima naudotis BOLD[[tik turint vien\u0105 formul\u0119, sudaryt\u0105 i\u0161 trij\u0173 ar keturi\u0173 ne\u017einom\u0173j\u0173, kuri\u0173 tik vienas t\u0117ra trupmenos skaitiklyje]] (arba kitaip tariant, tik pa\u010dioms papras\u010diausioms formul\u0117ms).',!1,16,null)
B.b4S=new A.c0("Kaitinant k\u016bnus, juos sudaran\u010dios dalel\u0117s pradeda grei\u010diau jud\u0117ti arba smarkiau svyruoti, tod\u0117l padid\u0117ja vidutiniai atstumai tarp j\u0173, taigi ir viso k\u016bno matmenys bei t\u016bris. I\u0161 jo poky\u010dio galima spr\u0119sti apie k\u016bno temperat\u016br\u0105, tod\u0117l \u0161iluminis k\u016bn\u0173 pl\u0117timasis gali b\u016bti temperat\u016bros matas.|N_2|BOLD[[Taigi, k\u016bn\u0173 temperat\u016brai kylant jie ple\u010diasi.]]",!1,16,null)
B.b4T=new A.c0('Jei \u012f puslaidinink\u012f \u012fterpsime med\u017eiagos (priemai\u0161os), BOLD[[kurios atomai turi daugiau elektron\u0173]] CBLU[[(tokios priemai\u0161os vadinamos donorin\u0117mis)]], dalis j\u0173 liks laisvi, nes elektron\u0173 bus daugiau nei j\u0173 gali prisijungti visi atomai.|N_1|Puslaidininkio su tokiomis priemai\u0161omis BOLD[[laidum\u0105 lemia elektron\u0173 jud\u0117jimas, tod\u0117l jis vadinamas elektroniniu laidumu (n laidumu), pats puslaidininkis \u2014 n puslaidininkiu]].|N_2|CBLU[[("n" pad\u0117s prisiminti angl. \u017eodis "negative", nes elektron\u0173 kr\u016bvis neigiamas).]]|N_6|Jei \u012f puslaidinink\u012f \u012fterpsime med\u017eiagos, BOLD[[kurios atomai turi ma\u017eiau elektron\u0173]] CBLU[[(tokios priemai\u0161os vadinamos akceptorin\u0117mis)]], j\u0173 bus per ma\u017eai, tod\u0117l atsiras daugiau skyli\u0173.|N_1|Tok\u012f puslaidininkio BOLD[[laidum\u0105 lemia skyli\u0173 jud\u0117jimas, tod\u0117l jis vadinamas skyliniu laidumu (p laidumu), o puslaidininkis \u2014 p puslaidininkiu.]]|N_2|CBLU[[("p" pad\u0117s prisiminti angl. \u017eodis "positive", nes skyl\u0117s turi teigiam\u0105 kr\u016bv\u012f).]]',!1,16,null)
