B.b4V=new A.c0("Elektronui i\u0161tr\u016bkus i\u0161 atomo i\u0161orinio sluoksnio, BOLD[[jame lieka laisva elektrono vieta, vadinama skyle, kuri turi teigiam\u0105 kr\u016bv\u012f]] (nes dingo neigiam\u0105 kr\u016bv\u012f turintis elektronas).|N_1|CBLU[[\u012e \u0161i\u0105 viet\u0105 gali per\u0161okti kitas elektronas i\u0161 gretimo atomo. Tada skyl\u0117 atsiras kitoje vietoje, \u012f j\u0105 v\u0117l per\u0161oks kito atomo elektronas ir t.t.]]|N_1|Taigi \u0161ios skyl\u0117s ir elektronai (teigiamieji ir neigiamieji kr\u016bvininkai) puslaidininkiu juda netvarkingai.|N_6|Kai puslaidininkis prijungiamas prie srov\u0117s \u0161altinio, laisvieji elektronai ir skyl\u0117s atsiduria elektriniame lauke ir ima jud\u0117ti kryptingai: laisvieji elektronai \u2014 \u012f vien\u0105 pus\u0119, skyl\u0117s \u2014 \u012f prie\u0161ing\u0105 pus\u0119. Puslaidininkyje atsiranda elektros srov\u0117.|N_1|BOLD[[\u0160is laidumas b\u016bdingas gryniems puslaidininkmas ir yra vadinamas savaiminiu laidumu.]]|N_1|CBLU[[Kaitinant arba ap\u0161vie\u010diant puslaidinink\u012f, kr\u016bvinink\u0173 jame daug\u0117ja, tod\u0117l did\u0117ja ir elektrinis puslaidininkio laidumas.]]",!1,16,null)
