B.b4X=new A.c0("BOLD[[Puslaidininkio p srit\u012f prijungus prie srov\u0117s \u0161altinio neigiamojo poliaus, o n srit\u012f \u2014 prie teigiamojo poliaus (2 pav.), per sand\u016br\u0105]] XBLD[[srov\u0117 neteka.]]|N_2|p (teigiamoji, pilna skyli\u0173) sritis yra neigiamojoje poliaus pus\u0117je, tod\u0117l tik i\u0161 jos gali jud\u0117ti elektronai. Ta\u010diau joje n\u0117ra laisv\u0173j\u0173 elektron\u0173, tod\u0117l n\u0117ra kryptingo kr\u016bvinink\u0173 jud\u0117jimo, tod\u0117l srov\u0117 neteka.",!1,16,null)
