B.b52=new A.c0("BOLD[[Garsas gali sklisti ne tik oru, bet ir kietaisiais k\u016bnais bei skys\u010diais.]] Nuo to, kuria tepre garsas sklinda, priklauso ir jo greitis ITAL[[(1 lentel\u0117)]]. Taip pat jis kinta ir nuo terp\u0117s temperat\u016bros, pavyzd\u017eiui, kylant temperat\u016brai, garso greitis did\u0117ja ITAL[[(2 lentel\u0117)]].\nBOLD[[Tuo tarpu vakuume jis nesklinda]], nes garsas t\u0117ra mechanin\u0117 banga, kuri pagal apibr\u0117\u017eim\u0105 - daleli\u0173 jud\u0117jimas (daleli\u0173 vakuume n\u0117ra).",!1,16,null)
B.b53=new A.c0("BOLD[[Gars\u0105 sukelia virpantys (16Hz - 20000Hz) k\u016bnai.]] Jie tai suspaud\u017eia, tai i\u0161retina greta esant\u012f or\u0105 - taip susidaro i\u0161ilgin\u0117 garso banga, kuri nuo garso \u0161altinio (virpan\u010dio k\u016bno) sklinda \u012f visas puses. Virpantis oras (t. y. garso banga), pasiek\u0119s \u017emogaus aus\u012f, veikia klausos organ\u0105, i\u0161 ten neuronais signalas nukeliav\u0119s \u012f smegenis suvokiamas kaip garsas.",!1,16,null)
